import "./TripRoute.css";
import "./fonts/fonts.css"

function TripRoute() {
  return <div className="TripRoute">
    <h1>------------------------------<br/>
    사용자 취향 기반<br/>
    여행 경로 추천 서비스<br/>
    ------------------------------</h1>
    <br/>
    <b id="emp">예정된 여행</b><text>에 대한 간단한 정보를 선택해주시면<br/>그에 맞는 3가지의 여행 경로를 추천해드립니다.<br/></text>
    <button id="start">정보 선택하러 가기</button>
  </div>;
}

export default TripRoute;
